  &lt;p style="margin-left:0cm; margin-right:0cm; text-align:justify"&gt;&lt;span style="font-size:16px"&gt;&lt;span style="background-color:white"&gt;A &lt;/span&gt;&lt;/span&gt;&lt;span style="font-size:20px"&gt;&lt;span style="background-color:white"&gt;&lt;strong&gt;Neocorp&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style="font-size:16px"&gt;&lt;span style="background-color:white"&gt; &amp;eacute; uma holding de participa&amp;ccedil;&amp;atilde;o em novos neg&amp;oacute;cios, que busca diversificar seus investimentos atrav&amp;eacute;s de empresas socialmente respons&amp;aacute;veis no &amp;acirc;mbito &amp;eacute;tico e ecol&amp;oacute;gico, com alavancado potencial de crescimento, independente do setor de atua&amp;ccedil;&amp;atilde;o, principalmente empresas em um est&amp;aacute;gio mais avan&amp;ccedil;ado de desenvolvimento (&lt;em&gt;Private Equity&lt;/em&gt;).&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;

&lt;p style="margin-left:0cm; margin-right:0cm; text-align:justify"&gt;&amp;nbsp;&lt;/p&gt;

&lt;p style="margin-left:0cm; margin-right:0cm; text-align:justify"&gt;&lt;span style="font-size:16px"&gt;&lt;span style="background-color:white"&gt;Temos participa&amp;ccedil;&amp;atilde;o em empresas de diversos segmentos, como, Engenharia e Constru&amp;ccedil;&amp;atilde;o, Prote&amp;ccedil;&amp;atilde;o a Marca e Gest&amp;atilde;o de Inserv&amp;iacute;veis e Res&amp;iacute;dues, contribuindo ativamente nestas, atrav&amp;eacute;s da presta&amp;ccedil;&amp;atilde;o de suporte estrat&amp;eacute;gico, operacional, administrativo, jur&amp;iacute;dico e comercial.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;

